import React from 'react'
import styled from 'styled-components'

const Wrapper = styled.div`
  font-size: 24px;
  font-weight: 700;
  font-family: MicrosoftYaHei;
  margin-bottom: 25px;
  color: #fec107;
  text-align: center;
`

const Title = styled.h1`
  font-size: 30px;
  color: #ffd658;
  padding: 10px 0;
`

componentDidMount() 

const Chart = (props) => {

  return (
    <Wrapper>
      <div id="chart"
      />
    </Wrapper>
  )
}

export default Chart
